    false,nt"url": null,nt"notes": "This annual narrative report for Waubay
    Wetland Management District outlines Refuge accomplishments during the 1978 calendar
    year. The report begins by giving a brief introduction to the district, as well
    as the climatic and habitat conditions, land acquisition program, and system status
    during the year. The construction and maintenance section discusses construction
    and maintenance. Habitat management is discussed; topics include croplands, grasslands,
    wetlands, and easements for waterfowl production. Wildlife- including migratory
    birds and big game animals- is also covered. The interpretation and recreation section
    discusses information and interpretation, recreation, and enforcement. Cooperative
    programs, items of interest, and safety are discussed.",nt"license_title":
